<?phpdeclare(strict_types=1);namespace App\Military\Entity\Units;use Doctrine\ORM\Mapping as ORM;use Ramsey\Uuid\Uuid;/** * @ORM\Entity(readOnly=true) * @ORM\Table(name="military_units_officilas", uniqueConstraints={ *      @ORM\UniqueConstraint(columns={"officials_unit", "officials_rank", "officials_fio", "officials_telephone"}) * }) */class UnitsOfficials{    /**     * @ORM\Column(type="guid")     * @ORM\Id     */    private string $id;    /**     * @ORM\ManyToOne(targetEntity="Units", inversedBy="officials")     * @ORM\JoinColumn(name="units_id", referencedColumnName="id", nullable=false, onDelete="CASCADE")     */    private Units $units;    /**     * @ORM\Embedded(class="Officials")     */    private ?Officials $officials;    public function __construct(Units $units, Officials $officials)    {        $this->id = Uuid::uuid4()->toString();        $this->units = $units;        $this->officials = $officials;    }    /**     * @return Officials     */    public function getOfficials(): Officials    {        return $this->officials;    }}